// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.4;
import "@openzeppelin/contracts/access/Ownable.sol";
import "./Artifact.sol";
import "./ICertification.sol";
import "./IArtifact.sol";


contract ArtiFactory is Ownable{

    address private MARKETX;
    address private CERTIFICATION_REGISRTY;
    
    uint private AMOUNT_LIMIT = 1;//maximum amount of Artifacts that can be created in one transaction 
    string internal baseMetadataURI = "https://gateway.pinata.cloud/ipfs/";

    address[] private TOKENS; //an array that contains different ERC1155 TOKENS deployed
    uint public N_TOKENS = 0; 
    mapping(address => uint) private addressToIndex;

    event ArtifactCreated(address owner, address tokenContract); //emitted when ERC1155 token is deployed

    constructor(address certificationRegistry, address marketplace) public {
        MARKETX = marketplace;
        CERTIFICATION_REGISRTY = certificationRegistry;
    }

    modifier onlyWhitelisted(){
        require(ICertification(CERTIFICATION_REGISRTY).isWhitelisted(msg.sender),"ArtiFactory: This address is not ACM");
        _;
    }

    function setMarketPlace(address _marketplace) public onlyOwner{
        MARKETX = _marketplace;
    }

    function setAmountLimit(uint _limit) public onlyOwner{
        AMOUNT_LIMIT = _limit;
    }

    function setBaseMetaDataURI(string memory _baseMetadataURI) public onlyOwner {
        baseMetadataURI = _baseMetadataURI;
    }

    function getBaseMetaDataURI() public view returns(string memory) {
        return baseMetadataURI;
    }
 
    function deployArtifact(string memory _contractName, string memory _tokenURI, uint _price) public onlyWhitelisted returns (address) {
        Artifact t = new Artifact(_tokenURI, _contractName, TOKENS.length, AMOUNT_LIMIT, _price, msg.sender, MARKETX);
        TOKENS.push(address(t));
        N_TOKENS++;
        addressToIndex[address(t)] = TOKENS.length - 1;
        emit ArtifactCreated(msg.sender,address(t));
        return address(t);
    }

    function getIndexByAddress(address _artifactAddress) public view returns(uint) {
        return addressToIndex[_artifactAddress];
    }

    function getAddressByIndex(uint id) public view returns(address) {
        return TOKENS[id];
    }

    function getURIByIndex(uint id) public view returns(string memory){
        return IArtifact(getAddressByIndex(id)).uri(id);
    }

}
